The Saint-Maurice River flows North to South in central Quebec from Gouin Reservoir to empty into the Saint Lawrence River at Trois-Rivières, in province of Quebec, in Canada. From its source at Gouin Reservoir, located at the same latitude as the Lac Saint-Jean, the river has a total drop of about 405 meters, to finally reach the river Trois-Rivières. The river is 563 km in length and has a drainage basin of 43,300 km² (16,700 mile²). Saint-Maurice river is one of the most important tributaries of St. Lawrence river. The main tributaries of the Saint-Maurice River are: 
*  Matawin River, whose mouth is at Matawin (Hamlet); 
*  Vermillon River (La Tuque) which empties about 23 km (by water) upstream (north) of the Beaumont generating station in La Tuque; 
*  Manouane River (La Tuque) which empties about 115 km (by water) upstream (north) of La Tuque; 
*  La Trenche River (La Tuque) which empties near the La Trenche Generating Station; 
*  Croche River (La Tuque) which empties at north of La Tuque. Between Weymontachie and Trois-Rivières, the St-Maurice River has 27 tributaries identified as significant enough for downhill wood: Weymontachingue, Manouane, Little Rock, Little Flamand, Windigo, Flamand, Coucoucache, Grande Pierriche (Great Pierriche), Petite Pierriche (Little Pierriche), "La Trenche", Vermillion, Croche, Rivière-au-Lait, Bostonnais, Little Bostonnais, Small Stream, Mountain, Caribou, Rivière-aux-Rats, Wessonneau, Little Batiscan River, l'Oiseau (Bird), Bête Puante (Beast Puante), Mattawin, Mekinac, River "au Lac des Pêches" and Shawinigan River. During the 18th century, early fur traders travelled along the river. During the second half of the 19th century, logging became an important industry in the surrounding Mauricie region. For much of the 20th century, the river was used to transport logs to mills down river and it was, and still is, a major source of hydroelectric power. First communication channel in this region, the river was used by local Native Americans long before the arrival of Europeans on the spot. Early explorations by religious conversion in pain and trappers in search of furs for the trade, it was one of the primary routes of rivers in Quebec. Several municipalities have been established on its banks, thereby taking advantage of its hydroelectric power where the falls were high enough to install a dam integration an electrical generating station. Among other cities, La Tuque, Shawinigan and Trois-Rivières are the best known, are themselves located along the Route 155 which connects the St. Lawrence River to Lake St. John.

Rio Grande (Portuguese for "great river") is a river in south-central Brazil. It rises in the Mantiqueira Mountains in the state of Minas Gerais and descends inland, west-northwestward. Its lower course marks a portion of the Minas Gerais-São Paulo border. At the Mato Grosso do Sul state border, after a course of 1,090 km (677 mi), it joins the Paranaíba River to form the Upper Paraná River. Major tributaries of the Rio Grande are: 
*  Rio Aiuruoca, whose source is in Itamonte; 
*  Rio das Mortes, whose source lies between Barbacena and Nossa Senhora dos Remédios, Piauí; 
*  Rio Jacaré, whose source is in the Serra do Galba; 
*  Rio Sapucaí, whose source is in the Mantiqueira Mountains in São Paulo; 
*  Rio Pardo, whose source is in Ipuiúna. The basin of the Rio Grande belongs to the Paraná River basin. It has a total area of 143,000 km2 (55,213 sq mi), of which 86,500 km2 (33,398 sq mi) are located within Minas Gerais, which is equivalent to 17.8% of the state territory. The basin of the Rio Grande is responsible for about 67% of all energy generated in the state. The Grande is interrupted by several dams and reservoirs; in the upper Grande the river forms Furnas Dam, then Peixotos Dam, and downstream, Luiz Barreto Dam, Jaguara Dam, Volta Grande Dam, Marimbondo Dam and Água Vermelha Dam. The river plays a major role in production of electricity and, due to rapids and waterfalls, and absence of locks, is only navigable by small craft in limited stretches. However the Estrada de Ferro Oeste de Minas (a narrow gauge railway) operated a passenger and freight steam navigation service between 1889 and 1963. The EFOM met the Rio Grande at Ribeirão Vermelho, from where the service ran down the river for 208 km (129 mi), as far as Capetina. There were six stations on the river between Ribeirão Vermelho and Capetinga, and the railway operated a fleet of 6 stern-wheel paddle steamers, together with barges and launches. The service was halted by the completion of the Furnas Dam.
